import React from 'react'
import "./widgetsmsec.css"
import ArrowDownwardIcon from '@material-ui/icons/ArrowDownward';
// import ArrowUpwardIcon from '@material-ui/icons/ArrowUpward';

export default function Widgetsmsec() {
    return (
        <div className="widgetsmsec">
            <div className="widgrtsmsecItem">
            <span className="widgrtsmsecTitle">Revenue</span>
                <div className="widgrtsmsecIdContianer">
                    <span className="widgetsmsecId">$400,340</span>
                    <span className="widgrtsmsecRate">
                        -$13 <ArrowDownwardIcon className='widgetsmsecIcon'/>
                        </span>
                </div>
                <span className="widgrtsmsecSub">Compared to last 24hrs</span>
            <div/> 
            </div>

        </div>
    )
}
